  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0081024 includes chemical,
  meteorological, physical and underway - surface data collected from S. A. AGULHAS
  in the Indian Ocean and South Atlantic Ocean from 2009-01-26 to 2011-01-10 and retrieved
  during cruise 91AA20090126. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE
  (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, Partial
  pressure (or fugacity) of carbon dioxide, SALINITY and SEA SURFACE TEMPERATURE.
  The instruments used to collect these data include Carbon dioxide (CO2) gas analyzer
  and Shower head chamber equilibrator for autonomous carbon dioxide (CO2) measurement.
  These data were collected by Dr Pedro M.S. Monteiro of Council for Scientific and
  Industrial Research as part of the VOS_Agulhas_Lines data set.nnThe Global Volunteer
  Observing Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon
  Coordination Project (IOCCP). International groups from 14 countries have been outfitting
  research ships and commercial vessels with automated CO2 sampling equipment to analyze
  the carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
